import React from "react";
import { createRoot } from 'react-dom/client';
import {Provider} from 'react-redux'; // Keeps track of store (global state) - allows access from anywhere inside app
import {createStore, applyMiddleware, compose} from 'redux'; 
import App from './App';
import './index.css';

const store = createStore(reducers, compose(applyMiddleware(thunk))); // TODO: Fix the createStore deprecation

const container = document.getElementById('root');
const root = createRoot(container);
root.render(
    <Provider store={store}>
        <App />
     </Provider>
);
